import com.sun.org.apache.xpath.internal.operations.Bool
import java.util.*
import kotlin.math.abs
import kotlin.system.measureTimeMillis

fun main(args: Array<String>) {
    val sc = Scanner(System.`in`)
    val text = sc.nextLine()
//    val text = ""


    val min = 'a'.toInt()
    val size = 'z'.toInt() - min

    val intArray = IntArray(size)

    val measureTimeMillis = measureTimeMillis {

        //    val charList = text.toSet().toList()

        text.forEach {
            val i = it.toInt() - min
            intArray[i]++
        }

//        val frecuancyList = text.groupBy { it }.values.map { it.count() }
        val frecuancyList = intArray.filter { it != 0 }

        val first = frecuancyList[0]
        val count = frecuancyList.count { it == first }
        if (count == frecuancyList.count()) {
            println("YES")
            return@measureTimeMillis
        } else if (count == 1) {
            val second = frecuancyList[1]
            val find = frecuancyList.count { it == second } == frecuancyList.count() - 1
            if (find) {
                println("YES")
                return@measureTimeMillis
            }

        } else if (count == frecuancyList.count() - 1) {
            val find = frecuancyList.find { it != first }!!
            if (abs(first - find) == 1 || find == 1) {
                println("YES")
                return@measureTimeMillis
            }
        }
        println("NO")
    }
    println(measureTimeMillis)

}
